import React, { useState } from 'react';
import { loginUser } from '../services/api';  // Importing the login helper API function
import { useNavigate } from 'react-router-dom'; // Importing useNavigate
import './Login.css';  // Import your CSS for styling

const Login = ({ setEmail }) => {
    const [email, setEmailInput] = useState('');  // User email state
    const [password, setPassword] = useState('');  // User password state
    const [error, setError] = useState('');  // Error state for invalid credentials
    const [loading, setLoading] = useState(false);  // Loading state for button
    const navigate = useNavigate();  // Initialize useNavigate

    const handleLogin = async (e) => {
        e.preventDefault();  // Prevent form default behavior
        setLoading(true);
        setError('');  // Reset any existing error message

        try {
            // Call the loginUser function and handle success or error
            const response = await loginUser(email, password);

            if (response) {
                // On success, store the CompanyInfo object and token in sessionStorage
                sessionStorage.setItem('email', email);  // Save email to sessionStorage
                sessionStorage.setItem('companyInfo', JSON.stringify(response.companyInfo));  // Store company info
                sessionStorage.setItem('token', response.token);  // Store token

                // Optionally, you can update the email in App state
                setEmail(response.companyInfo.email);  // Update App state with email

                // Redirect to the welcome page using navigate (no page reload)
                navigate('/welcome');
            } else {
                setError('Invalid credentials');  // Handle error if credentials are wrong
            }
        } catch (error) {
            setError(error.message || 'Login failed. Please try again.');  // Set error message from loginUser
        } finally {
            setLoading(false);  // Turn off the loading state
        }
    };

    return (
        <div className="login-container">
            <div className="form-wrapper">
                <img
                    src="https://i.postimg.cc/WbVD3VTV/authentication.png"
                    alt="Login Illustration"
                    className="form-img"
                />
                <form onSubmit={handleLogin} className="form-content">
                    <h1 className="form-title">Welcome </h1>

                    {error && <p className="error-message">{error}</p>}  {/* Error message */}

                    <div className="form-div">
                        <div className="form-icon">
                            <i className="bx bxs-user-circle"></i>
                        </div>
                        <div className="form-div-input">
                            <label htmlFor="email" className="form-label">Username</label>
                            <input
                                type="email"
                                id="email"
                                className="form-input"
                                value={email}
                                onChange={(e) => setEmailInput(e.target.value)}  // Update email state
                                required
                            />
                        </div>
                    </div>

                    <div className="form-div">
                        <div className="form-icon">
                            <i className="bx bx-lock"></i>
                        </div>
                        <div className="form-div-input">
                            <label htmlFor="password" className="form-label">Password</label>
                            <input
                                type="password"
                                id="password"
                                className="form-input"
                                value={password}
                                onChange={(e) => setPassword(e.target.value)}  // Update password state
                                required
                            />
                        </div>
                    </div>

                    <a href="#" className="form-forgot">Forgot Password?</a>

                    <button type="submit" className="form-button" disabled={loading}>
                        {loading ? 'Logging in...' : 'Login'}
                    </button>

                    <div className="form-social">
                        <span className="form-social-text">Or login with</span>

                        <a href="#" className="form-social-icon"><i className="bx bxl-facebook"></i></a>
                        <a href="#" className="form-social-icon"><i className="bx bxl-google"></i></a>
                        <a href="#" className="form-social-icon"><i className="bx bxl-instagram"></i></a>
                    </div>
                </form>
            </div>
        </div>
    );
};

export default Login;
